import React, {Component} from "react"

class Projekcije extends Component{

    constructor(){
        super()
        this.state = {
            projekcije:[]
        }
    }

    componentDidMount(){
        const conf={
            headers: new Headers({'Authorization': 'Bearer ' + localStorage.getItem('jwt')},
                                  {'Access-Control-Allow-Methods':'GET'}),
          };

        fetch('http://localhost:8080/bioskop/projekcije',conf)
            .then(res => res.json())
            .then(response => {
                this.setState({
                    projekcije: response
            })
        })
    }

    render(){
        return(
            <div id="idProjekcije">
                <h1>Sve projekcije!</h1>
            </div>
        )
    }
}

export default Projekcije
